import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';

function ResultList() {
    let initialSearchResults = useSelector(state => state.result.appState);


    return (

        <div id='resultsholder'>
            <div id='resultwindow'>
                {initialSearchResults.map((value, index) => <div
                    className='resultcard'
                    onClick={(index) => {

                        map.setZoom(18);
                        let latlng = {
                            lat: value.lat,
                            lng: value.lng

                        }
                        map.setCenter(latlng);

                    }}
                    key={index}
                    id={`content${index}`}>

                    <div>
                        <div className='resultindex'>{index + 1}</div>
                    </div>
                    <div>
                        <div className='resulttext'>{value.name}</div>
                        <div className='resultvic'>{value.vicinity}</div>
                        <div className='resultrating'>{
                            (() => {
                                let str = '';
                                for (let i = 1; i < value.rating; i++) {
                                    str += '☆';
                                }
                                return <span>{str}</span>
                            })()
                        }</div>
                    </div>
                </div>)}

            </div>
        </div>
    )


}
